import PokeCard from "./components/PokeCard.jsx";
import Topo from "./components/Topo.jsx";
import axios from "axios";
import { getPokemon } from "./components/PokeLi";
import React, { useEffect } from "react";

let PokemonWhatever = [];

function App() {
  const handlepokemon = (newPokemon) => {
    PokemonWhatever = [...PokemonWhatever, newPokemon];

    console.log(PokemonWhatever);
  };

  useEffect(() => {
    Array(150)
      .fill()
      .map((_, index) => {
        const pokemon = getPokemon(index + 1, handlepokemon);
        return pokemon;
      });
  }, []);

  return (
    <div>
      <Topo></Topo>
      {PokemonWhatever.map((i) => {
         const elementTypes = i.types(typeInfo => typeInfo.type.name)
        return <PokeCard name={i.name} id={i.id} />;
      })}
    </div>
  );
}

export default App;
